(function() {
	window.AppIndicatorPart = class extends window.Part {
		constructor(e) {
			super(e);

			e = e || {};
			$.extend(this, {
				lastStates: {
					ajax: undefined,
					db: undefined
				},
				id2Part: {}/* stateUpdateTimers: {} */
			});
		}

		static get partName() {
			return 'appIndicator'
		}
		get partRoot() {
			return 'appBase/part/'
		}
		get defaultLayoutName() {
			return this.layout || this.template ? null : this.partName
		}

		async preInitLayout(e) {
			e = e || {};
			await super.preInitLayout(e);

			const layout = e.layout || this.layout;
			let id2Part = this.id2Part;
			$.extend(id2Part, {
				ajax: layout.find('#ledAjax'),
				db: layout.find('#ledDB')
			});
		}

		async postInitLayout(e) {
			e = e || {};
			await super.postInitLayout(e);

			Object.keys(this.lastStates).forEach(type=>this.xCallback({
				type: type,
				state: false
			}));
			this.initCallbacks(e);
		}

		initCallbacks(e) {
			let $self = $(window);
			$self.ajaxStart(()=>this.ajaxCallback({
				state: true
			})).ajaxStop(()=>this.ajaxCallback({
				state: false
			})).ajaxError((e,xhr,wsArgs,error)=>this.ajaxCallback({
				state: null,
				xhr: xhr,
				status: xhr.status,
				url: wsArgs.url
			}));
		}

		setUpTimers(e) {
			super.setUpTimers(e);

			$.extend(this.timers, {
				ledReset_db: {
					delay: 10000,
					interval: true,
					block: e=>this.resetCallback($.extend({}, e, {
						type: 'db'
					}))
				},
				ledReset_ajax: {
					delay: 60000,
					interval: true,
					block: e=>this.resetCallback($.extend({}, e, {
						type: 'ajax'
					}))
				}
			});
		}

		ajaxCallback(e) {
			e = e || {};
			return this.xCallback($.extend({}, e, {
				type: 'ajax',
				minDelay: 100
			}))
		}
		dbCallback(e) {
			e = e || {};
			return this.xCallback($.extend({}, e, {
				type: 'db',
				minDelay: 10
			}))
		}
		resetCallback(e) {
			e = $.extend({}, e, {
				state: false
			});
			if (e.type)
				this.xCallback(e);
			else {
				this.ajaxCallback(e);
				this.dbCallback(e)
			}
		}
		xCallback(e) {
			e = $.extend({}, e);
			const {lastStates} = this;
			let {type, state} = e;
			/* const stateUpdateTimers = this.stateUpdateTimers;
			if (stateUpdateTimers[type]) {
				clearTimeout(stateUpdateTimers[type]);
				delete stateUpdateTimers[type];
			} */
			let part = e.part = this.id2Part[type];
			if (!part)
				return false
			let lastState = lastStates[type];
			if (lastState === state)
				return false
			let xhr = e.xhr || {};
			let url = e.url || '';
			if (xhr.status == 404 || url.includes('cmd.php'))
				state = false
			const islemBlock = e=>e.part.prop('src', this.getImageSrc(e));
			// e.part.prop('src', this.getImageSrc(e));
			this.clearUniqueTimeout({ key: `stateUpdateTimer_${type}` });
			if (state == null) {
				this.setUniqueTimeout({
					key: `stateUpdateTimer_${type}`,
					delayMS: e.minDelay || 10,
					args: e, block: e=>islemBlock(e)
				})
			}
			else
				islemBlock(e)
			return true
		}

		getImageSrc(e) {
			e = e || {};
			const {state} = e;
			if (state != null) {
				// return state ? `images/${e.type == 'db' ? 'yellowdot' : 'greendot'}.png` : 'images/graydot.png';
				return state
					? e.type == 'db'
						? `data:image/png;base64,`
						: `data:image/png;base64,`
					: `data:image/png;base64,`;
			}

			// return `images/reddot.png`;
			return `data:image/png;base64,`;
		}
	}
}
)()
